import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

// Página Principal simple con botón a Login
function Home() {
  return (
    <div>
      <h1>Bienvenido a la Página Principal</h1>
      <Link to="/login">
        <button>Ir a Login</button>
      </Link>
    </div>
  );
}

// Login (puedes poner tu componente real aquí)
function Login() {
  return (
    <div>
      <h2>Página de Login</h2>
      {/* Aquí va tu componente de login real */}
    </div>
  );
}

// App con rutas para Home y Login
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
